import React from 'react';
import "../css/style.css";
import "../css/normaliza.css";



function Main(props) {

  return (
    <React.Fragment>
      <main className="page">
    <div className="container">
      {props.children}
    </div>
  </main>
    </React.Fragment>
  );
}

export default Main;
